import React from 'react';

function Login() {
    return(
        <div className="auth">
            <h2 className="auth__title"></h2>
            <form action="post">
                <input 
                className="auth__input"
                type="text" 
                />

                <input 
                type="text" />

                <button type="submit" />
            </form>
        </div>
    )
}

export default Login;
